import React, { useState } from 'react';
import Result from './Result';

const Search = () => {
  const [img, setImg] = useState('');

  const inputEvnt = (e) => {
    const data = e.target.value;
    setImg(data);
  };
  return (
    <>
      <div className="searchbar">
        <input
          type="text"
          placeholder="Search Anything"
          onChange={inputEvnt}
          value={img}
        />
        <Result img={img} />
      </div>
    </>
  );
};

export default Search;
